import React from 'react';
import styled from 'styled-components';

const HeroContainer = styled.section`
  background: url('path-to-hero-image.jpg') no-repeat center center;
  background-size: cover;
  color: #fff;
  padding: 100px 0;
  text-align: center;
`;

const HeroHeadline = styled.h1`
  font-size: 36px;
  margin-bottom: 20px;
`;

const Subheadline = styled.p`
  font-size: 18px;
`;

const HeroSection = () => {
  return (
    <HeroContainer>
      <HeroHeadline>Welcome to Velvetyne Type Foundry</HeroHeadline>
      <Subheadline>Your Source for Unique Fonts</Subheadline>
      {/* Add CTA button */}
    </HeroContainer>
  );
};

export default HeroSection;
